- The basic building blocks of writing C and C++ extensions for the Python interpreter, and tools that make this even easier (like boost for C++);
- Tools that don’t require writing a line of C, but can give you a performance boost when you need it (like Cython).

This is a short talk that won’t go much deeper than some basic code examples. But we’ll look at different tools, how much they can pay off and how easy it really is to integrate them in Python applications.
